import React from 'react';
import Chat from './chat';

export default function Appmain(props) {
  console.log(props.socket);
  return (
    <React.Fragment>
      <div className='right'>
        <Chat
          username={props.match.params.username}
          roomname={props.match.params.roomname}
          socket={props.socket}
        />
      </div>
    </React.Fragment>
  );
}
